import React from 'react';
import TableRow from './tablerow';

const Table = () => {
    return (
        <table className="table table-hover mt-5">
            <thead>
                <tr>
                <th scope="col">Pokemon</th>
                <th scope="col">Weakness</th>
                <th scope="col">Resistance</th>
                </tr>
            </thead>
            <tbody>
                <TableRow />
                <TableRow />
                <TableRow />
                <TableRow />
                <TableRow />
                <TableRow />
            </tbody>
        </table>
    );
};

export default Table;
